function WorkPage() {
    return (
        <div>
            <div className="workContainer">
                <div className="digitalTree">
                    <svg viewBox="0 0 100 100">
                        <path d="M 10 20 l 15 3  20 10 l -20 0"/>
                    </svg>
                </div>
            </div>
            <h1>this is gonna be a work page</h1>
        </div>
    );
}

export default WorkPage;
